  ["jammable"] = "<html><body><h1>jammable</h1><p>jammable<p></p>adj.<p></p>jam1的变形<p></p>jam1<p></p>[dʒæm]<p></p>vt.<p></p>把…挤进(或塞进)；把…塞满，使挤紧：<p></p>He jammed his clothes into a black suitcase.<p></p>他把衣服塞进了一只黑手提箱。<p></p>The bus was jammed full.<p></p>公共汽车挤得满满的。<p></p>使(道路等)堵塞，塞住：<p></p>The traffic was jammed for an hour.<p></p>交通阻塞了一个小时。<p></p>使(机器等)轧住，卡住；使失灵：<p></p>What worried him was that his broken key jammed the lock.<p></p>让他焦急不安的是折断的钥匙把锁孔给卡住了。<p></p>The ship was jammed between two rocks.<p></p>这艘船被夹在两块暗礁之间。<p></p>轧伤，挤伤，扭伤；压碎，碾碎：<p></p>His finger was jammed in a train door.<p></p>他的手指被火车门轧伤了。<p></p>The man jammed out his cigarette to show his respect for the lady.<p></p>那个男人拈灭了香烟以显示他对该女士的尊敬。<p></p>猛推，猛压；拉紧，抽紧：<p></p>The driver<p></p>jammed his foot on the brake.<p></p>司机用脚猛踩刹车。<p></p>He had no choice but to jam his way through the crowd.<p></p>他别无选择，只得推推搡搡挤出人群。<p></p>【无线电】干扰：<p></p>They successfully jammed the enemy's station during the war.<p></p>他们在战争期间成功地干扰了敌军的电台。<p></p>溜掉，跑掉；旷课：<p></p>He jammed the party.<p></p>他从聚会上溜走了。<p></p>vi.<p></p>挤满，拥挤；塞紧；堵塞：<p></p>They jammed into the elevator.<p></p>他们挤进电梯。<p></p>卡住，(机器等)轧住不能动弹；失灵，发生故障：<p></p>The gearing jammed.<p></p>齿轮卡住了。<p></p>The brakes jammed.<p></p>刹车失灵了。<p></p>[美国俚语]自由发挥地即席演奏爵士乐；参加即兴音乐演奏会[亦作 jam session]<p></p>[常用作分词](作为一名团体的成员)卖命地工作<p></p>n.<p></p>拥挤，挤满；堵塞，阻塞；拥挤的人群；堵塞物<p></p>(机器等)轧住，卡住；停顿<p></p>[美国口语]困境；窘境<p></p>【无线电】干扰<p></p>爵士乐即兴演奏会<p></p>(旱冰运动中的) 60秒速度滑冰<p></p>旱冰速滑比赛(超过对手的)得分圈<p></p>[美国俚语]举手之劳的事情<p></p>[美国俚语]唱片，录音带；音乐<p></p>adj.<p></p>[美国俚语、同性恋者用语]异性恋的<p></p>变形：<p></p>vt.<p></p>jammed<p></p>. jamming</p></body></html>",
